import React, { Component } from 'react';

import "bootstrap/dist/css/bootstrap.min.css";

export default class Register extends Component {

    render() {
        return (
	    <table>
	      <tbody>
		<tr>
		  <td><label htmlFor="username" className="col-form-label">Username: </label></td>
		  <td><input type="text" placeholder="Enter username: " id="username" className="form-control" onChange={(text) => this.props.onRegisterUsernameChange(text)} /></td>
		</tr>
		<tr>
		  <td><label htmlFor="password" className="col-form-label">Password: </label></td>
		  <td><input type="password" placeholder="Enter password: " id="password" className="form-control" onChange={(text) => this.props.onRegisterPasswordChange(text)} /></td>
		</tr>
		<tr>
		  <td><button className="btn btn-primary btn-sm m-2" onClick={() => this.props.onRegister()}>Register</button></td>
		</tr>
	      </tbody>
	    </table>
        )
    }
}
